def delList(dataMat):
    list = []
    for j in dataMat:
        list.append(len(j))
    #print(max(list))
    listF = []
    a = max(list)
    # x = [None]*a
    # print(x)
    i = 0
    for list in dataMat:
        newlist = []
        for j in list:
            newlist.append(j)
        i = 0
        while i < a:
            if len(newlist) >= a:
                break
            else:
                newlist.append(0)
                i = i + 1
        listF.append(newlist)
        print(len(newlist))
        # print(list)
    return listF
